package com.example.intents;

import android.content.Intent;
import android.os.Bundle;
import android.view.View;
import android.widget.ImageView;

import androidx.appcompat.app.AppCompatActivity;

import com.bumptech.glide.Glide;


public class ClCartelera extends AppCompatActivity implements View.OnClickListener {


    ImageView imgRestaurante,imgRestaurante2,imgRestaurante3,imgmatparc;
    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.cartelera);

        imgRestaurante = findViewById(R.id.imgRes);
        imgRestaurante2 = findViewById(R.id.imgRes2);
        imgRestaurante3 = findViewById(R.id.imgRes3);
        imgmatparc = findViewById(R.id.matparc);



        //Detectar clic botons:

        imgmatparc.setOnClickListener(this);
        Glide.with(this)
                .load("data:image/jpeg;base64,")
                .into(imgRestaurante);
        Glide.with(this)
                .load("data:image/jpeg;base64,")
                .into(imgRestaurante2);
        Glide.with(this)
                .load("data:image/jpeg;base64,")
                .into(imgRestaurante3);
    }

    @Override
    public void onClick (View v){
        if (v.getId() == R.id.matparc) {
            Intent pag = new Intent(this, MainActivity.class);
            startActivity(pag);
        }
    }

}
